import React from 'react'



var strength = 0;
var constitution = 0;
var dexterity = 0;
/*
const attributes = {
    strength: '20',
    constitution: '0',
    dexterity: '0'
}*/


function setStrength() {
    return strength = Math.random(20)
}

class Hero extends React.Component {
    render() {
        const strength = this.props.strength;
        return (
            <div>
            <div>
                <p> Strength: {strength}</p>
            </div>
            <div>
                <button onClick={setStrength}>set Strength</button>
            </div>
            </div>
        );
    }
}

export default Hero;
